import axios from 'axios';
import { useEffect, useState } from 'react';

function UseEffectData(url) {
  const [data, setData] = useState([]);

  useEffect(() => {
    const allData = async () => {
      try {
        const { data } = await axios.get(url);
        setData(data);
      } catch (error) {
        console.log(error);
      }
    };
    allData();
  }, [url]);
  return data;
}

export default UseEffectData;
